import './App.css';
import './components/Navbar';
import './components/Footer';
import './pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" exact ></Route>
        </Routes>
      </Router>
      Hello!
    </div>
  );
}

export default App;
